import { makeStyles } from '@material-ui/core';
const useStyles = makeStyles(() =>({
    title:{
        marginLeft: '16px',
        fontFamily: "Prompt",
        fontWeight:'bolder',
        color: '#f62f5e',
        letterSpacing: '8px',
    },
    appBar:{
        display: 'flex',
        backgroundColor: '#2e2e2e',
        padding: '28px 0',
        alignItems: 'center',
    }
}))
export default useStyles;
